/* eslint-disable no-constant-condition */

import { take, put, call, fork, race, cancelled } from 'redux-saga/effects'
import { eventChannel, END } from 'redux-saga'
import {
  INCREMENT_ASYNC,
  INCREMENT,
  CANCEL_INCREMENT_ASYNC,
  CANCEL_DECREMENT_ASYNC,
  COUNTDOWN_TERMINATED,
  DECREMENT,
  DECREMENT_ASYNC,
} from '../actionTypes'

const action = type => ({ type })

/*eslint-disable no-console*/
export const countdown = secs => {
  console.log('countdown', secs)
  return eventChannel(listener => {
    const iv = setInterval(() => {
      secs -= 1
      console.log('countdown', secs)
      if (secs > 0) listener(secs)
      else {
        listener(END)
        clearInterval(iv)
        console.log('countdown terminated')
      }
    }, 1000)
    return () => {
      clearInterval(iv)
      console.log('countdown cancelled')
    }
  })
}

export function* incrementAsync({ value }) {
  const chan = yield call(countdown, value)
  try {
    while (true) {
      let seconds = yield take(chan)
      yield put({ type: INCREMENT_ASYNC, value: seconds })
    }
  } finally {
    if (!(yield cancelled())) {
      yield put(action(INCREMENT))
      yield put(action(COUNTDOWN_TERMINATED))
    }
    chan.close()
  }
}
export function* watchIncrementAsync() {
  try {
    while (true) {
      const action = yield take(INCREMENT_ASYNC)
      // starts a 'Race' between an async increment and a user cancel action
      // if user cancel action wins, the incrementAsync will be cancelled automatically
      yield race([call(incrementAsync, action), take(CANCEL_INCREMENT_ASYNC)])
    }
  } finally {
    console.log('watchIncrementAsync terminated')
  }
}


export function* decrementAsync({ value }) {
  const chan = yield call(countdown, value)
  try {
    while (true) {
      let seconds = yield take(chan)
      yield put({ type: DECREMENT_ASYNC, value: seconds })
    }
  } finally {
    if (!(yield cancelled())) {
      yield put(action(DECREMENT))
      yield put(action(COUNTDOWN_TERMINATED))
    }
    chan.close()
  }
}
export function* watchDecrementAsync() {
  try {
    while (true) {
      const action = yield take(DECREMENT_ASYNC)
      // starts a 'Race' between an async increment and a user cancel action
      // if user cancel action wins, the incrementAsync will be cancelled automatically
      yield race([call(decrementAsync, action), take(CANCEL_DECREMENT_ASYNC)])
    }
  } finally {
    console.log('watchDecrementAsync terminated')
  }
}

export default function* rootSaga() {
  yield fork(watchIncrementAsync)
  yield fork(watchDecrementAsync)
}

